import { moduleMetadata } from '@storybook/angular';
import { CardComponent } from './card.component';
export default {
    title: 'CardComponent',
    component: CardComponent,
    decorators: [
        moduleMetadata({
            imports: [],
        })
    ],
};
const Template = (args) => ({
    props: args,
});
export const Primary = Template.bind({});
Primary.args = {
    year: '2023',
    name: 'Santhoshini',
    isChampion: false,
};
